{"url": "https://www.mist.com/documentation/category/wlan-configuration/page/2/", "paragraph_number": 4, "snippet": "Personal WLANs are are secure micro-segmented networks across a single WLAN. \u00a0These Personal WLANs are created by generating unique keys to access the SSID. \u00a0Each of these keys automatically creates a segment of the WLAN, isolated from the other Personal WLANs on the same network.\u00a0 This is limited to 5000 PSKs (with suggested/select firmware) To...", "subtitle": "Personal WLANs", "title": "WLAN Configuration", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588892, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wlan-configuration/page/2/", "paragraph_number": 5, "snippet": "Every PSK (Pre-shared Key) has a Key Name This name is reported in the Mist Management platform Allows user level accountability with PSK simplicity If a PSK is compromised there is no need to change every client. Multiple users allow any number to use the key Single user ties this key to a specific MAC...", "subtitle": "Multi PSK", "title": "WLAN Configuration", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588892, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wlan-configuration/page/2/", "paragraph_number": 6, "snippet": "Please note: WEP Authentication is not available by default.\u00a0 If you would like to use WEP in your WLAN, please contact us and we will enable this feature for you. WLANs with WEP are enabled for compatibility with older clients that cannot be connected with the more modern security security protocols such as WPA-2. If...", "subtitle": "WEP Security", "title": "WLAN Configuration", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588892, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wlan-configuration/page/2/", "paragraph_number": 7, "snippet": "Please note: TKIP Encryption is not available by default.\u00a0 If you would like to use TKIP in your WLAN, please contact us and we will enable this feature for you. WPA-2 with TKIP is enabled for compatibility with older clients that cannot be connected with the AES encryption protocol. \u00a0If your device is compatible, we...", "subtitle": "TKIP Security", "title": "WLAN Configuration", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588892, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wlan-configuration/page/2/", "paragraph_number": 8, "snippet": "STATIC VLANs First configure a WLAN by going to Network > WLANs and then select Tagged in the VLAN section to configure a static VLAN for your network.\u00a0 Here, enter your VLAN ID and make sure the same VLAN is tagged on your switch port. By default a WLAN will be set not to use...", "subtitle": "VLANs (Static & Dynamic)", "title": "WLAN Configuration", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588892, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wlan-configuration/page/2/", "paragraph_number": 9, "snippet": "Can be enabled with any security RADIUS Server then used to authenticate using MAC address as username and password Change of Authorization(COA) \u2013 again an external server can instruct the re-authentication of a client VLAN can also be untagged, tagged or dynamic in the same way as 802.1x wireless can.", "subtitle": "MAC Authentication", "title": "WLAN Configuration", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588892, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wlan-configuration/page/2/", "paragraph_number": 10, "snippet": "RadSec is a protocol which allows RADIUS servers to transfer data over TCP and TLS for increased security. \u00a0With RadSec capabilities, you can transfer RADIUS packets through public networks while still ensuring end-to-end security through the transport layer. \u00a0This feature is configurable through using our Mist API or directly from the UI. UI configuration To...", "subtitle": "RadSec", "title": "WLAN Configuration", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588892, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wlan-configuration/page/3/", "paragraph_number": 2, "snippet": "By default Mist supports Proxy Arp. Mist APs by default support Proxy ARP. Mist APs on seeing an ARP request for a connected client, instead of forwarding the packet over the air, \u00a0formats an ARP response on behalf of the client and responds to the wired network. Wikipedia ARP Filter: When ARP filter is enabled,...", "subtitle": "Isolation", "title": "WLAN Configuration", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588892, "snippet_vector": ["to be implemented"]}
