{"url": "https://www.mist.com/documentation/category/location-faq/", "paragraph_number": 1, "snippet": "How to insert Walls To insert walls go to Wayfinding Paths and select insert walls when viewing a floor plan. Similar to inserting paths you select the points you want to set the nodes on points of the image that resemble walls. Although unlike wayfinding paths where the location estimate will gravity towards the nearest...", "subtitle": "Walls", "title": "Location FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588910, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wifi-faq/", "paragraph_number": 2, "snippet": "Making changes on the WLAN will cause the radio to reinitialize in order to obtain the new configuration. The radio reinitializes when adding a new WLAN or making any RF related changes to the WLAN. On the Client Events in the Insights page, you will see an AP Deauthentication being sent to the clients when...", "subtitle": "Why do clients disconnect when you add a new WLAN?", "title": "Wi-Fi FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wifi-faq/", "paragraph_number": 3, "snippet": "Deauthentication is not a request, it is a notification If a station wants to deauthenticate from an AP, or if an AP wants to deauthenticate from stations, either device can send a deauthentication frame. Because authentication is a prerequisite for association, a deauthentication frame will automatically cause a disassociation to occur. Deauthentication cannot be refused...", "subtitle": "What is the difference between AP deauthentication and Client deauthentication?", "title": "Wi-Fi FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wifi-faq/", "paragraph_number": 4, "snippet": "A Mist AP will pull a management IP address from the Native VLAN. By default, a Mist AP requests only one IP address i.e. from the Management VLAN (VLAN 1) Features that would require multiple DHCP addresses: Guest Portal If a guest portal is configured using the Mist portal and the Guest SSID is a...", "subtitle": "Why AP\u2019s use multiple IP addresses", "title": "Wi-Fi FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wifi-faq/", "paragraph_number": 5, "snippet": "When a Mist AP cannot reach the Mist Cloud, can end users with a wireless connection still communicate with the internet? With the local network? If config persistence was enabled on the AP before it lost connectivity to the Mist cloud, the AP will still be able to provide WiFi.\u00a0 The same goes for APs...", "subtitle": "AP Connectivity to the Mist Cloud", "title": "Wi-Fi FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wifi-faq/", "paragraph_number": 6, "snippet": "Our AP43 model supports 802.11ax, which may cause some interoperability issues with legacy clients.\u00a0 To disable the 802.11ax on your WLAN, simply navigate to your\u00a0WLAN Details page, and find the\u00a0WiFi Protocols box.\u00a0 In here, you may disable WiFi-6.\u00a0 This will disable WiFi-6 for that specific WLAN on AP43\u2019s, and will have no effect on other...", "subtitle": "Disable Wi-Fi 6", "title": "Wi-Fi FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wifi-faq/", "paragraph_number": 7, "snippet": "To blacklist any client manually, first go to Network > Security to classify and add client mac addresses as Banned clients. Either manually enter MAC Addresses or upload a file with the list of MACs. Or from API, we can make PUT request under \u2013 sites/:site_id/setting/blacklist with payload of mac addresses {\"macs\":[\"<<>>\",\"<<>>\"]} \u00a0 Next, navigate...", "subtitle": "Blacklist a Client", "title": "Wi-Fi FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wifi-faq/", "paragraph_number": 8, "snippet": "What does the Inactive wired VLANs warning message on the Mist Dashboard mean? The inactive wired VLANs error message appears on the dashboard when our APs don\u2019t detect incoming traffic from a particular VLAN that is used in either an AP or WLAN configuration. In this case our backend algorithm suspects that this VLAN is...", "subtitle": "Inactive Wired VLANs", "title": "Wi-Fi FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wifi-faq/", "paragraph_number": 9, "snippet": "Sometimes you may see events for AP Reflection Detection in our site events page(Analytics \u2192 Events tab). The AP Reflection Detected event shows that there is a possible loop in your network and the AP is receiving the packet it sent out. We detect this when the AP wired port receives a frame with the...", "subtitle": "What is AP Reflection?", "title": "Wi-Fi FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/wifi-faq/", "paragraph_number": 10, "snippet": "When setting up a universal template to be used across multiple sites, there are certain factors which may differ from site to site. Different sites may have unique VLAN configurations, and to support these use cases we are allowing VLAN IDs to be configured as a site variable. With this function, set the VLAN ID...", "subtitle": "VLANs configured as site variables", "title": "Wi-Fi FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/location-faq/", "paragraph_number": 2, "snippet": "Steps to access the search function in location live view: Navigate to Location \u2192 Live View on your org From Live View, click on a map to search related elements of that map (floor plan) Once you are on a floor plan you will see a search icon on the top right corner of the...", "subtitle": "Searching in Live View", "title": "Location FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/location-faq/", "paragraph_number": 3, "snippet": "Mist\u2019s RF glasses feature gives you a real-time view of the RF environment from the mobile user\u2019s perspective. This lets you detect coverage holes as the user moves around. The Beam Density map is the visual provided when using RF glasses to give the user a good representation of RSSI strength depending on location.\u00a0 In...", "subtitle": "Beam Density not showing up?", "title": "Location FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/location-faq/", "paragraph_number": 4, "snippet": "There are no issues when running vBLE alongside 2.4 GHz WiFi. Our Radio Resource Management automatically chooses channels 1, 6, and 11 on WiFi to avoid any interference between the BLE signals being transmitted simultaneously. BLE transmits on advertising channels 37, 38, and 39 with signals being only 2 MHz wide. These channels are located...", "subtitle": "vBLE impact on 2.4 GHz WiFi", "title": "Location FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/location-faq/", "paragraph_number": 5, "snippet": "AP Scan rate: APs in receive mode only (only Asset Visibility is turned on): APs scan every 800ms \u00a0 APs are in transmit + receive mode (Asset Visibility + Engagement turned on): APs scan every 420ms \u00a0 Data collection: Data is sent to the cloud every 2 seconds", "subtitle": "How often do the APs BLE scan/collect data for Location?", "title": "Location FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/location-faq/", "paragraph_number": 6, "snippet": "When creating a floorplan in Location Live View, we require you to attach an image to be used as the map.\u00a0 We strongly encourage the use of .png file formats, but if there are specific requirements for a desired image format please submit a support ticket and we will do our best to assist you...", "subtitle": "Supported Image Formats for Floor Plans", "title": "Location FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/location-faq/", "paragraph_number": 7, "snippet": "Location, especially wayfinding (which usually involves long hallways), can benefit from daisy chaining for power. This saves switch ports. To get four units as shown below, you need AT power either from an LLDP enabled switch (Cisco disables by default), or a 30-watt power injector for the first unit in the daisy chain. If it...", "subtitle": "BT11 Daisy Chaining", "title": "Location FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
{"url": "https://www.mist.com/documentation/category/location-faq/", "paragraph_number": 8, "snippet": "Mist APs can broadcast different types of beacons which have different payload structures. These Beacons are useful when customer want to broadcast beacons with different structure payloads. Apple created the iBeacon format so that your mobile device takes some action when it hears that iBeacon. This is the only way to let an application through...", "subtitle": "Broadcasting BLE Beacons (iBeacon, Eddystone UID, Eddystone URL)", "title": "Location FAQ", "image": "null", "image_url": "null", "type": "Documentation", "creationDate": 1592588911, "snippet_vector": ["to be implemented"]}
